import React from 'react';

var logo_content = "DUT MILK TEA";
function Header(props) {
    return (
        <div className="Header">
            <div className="Header-Logo">
                {/* <i className="fa-brands fa-facebook"></i> */}
                <img src={props.logo} alt="logo" className="Header-Logo-Image" />
                <p className="Logo-Content">{logo_content}</p>
            </div>
            <div className='Header-Navbar'>
                <div className='NavbarItem'>home</div>
                <div className='NavbarItem'>about</div>
                <div className='NavbarItem'>menu</div>
                <div className='NavbarItem'>contact</div>
            </div>
            <div className="Header-Account">
                <i class="fa-regular fa-user"></i>
                <i class="fa-solid fa-cart-shopping"></i>

            </div>
        </div>
    );
}

export default Header;
